// src/pages/DashboardListPage.jsx
import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import api from "../services/api";

function DashboardListPage() {
  const navigate = useNavigate();
  const [dashboards, setDashboards] = useState([]);
  const [title, setTitle] = useState("");

  useEffect(() => {
    fetchDashboards();
  }, []);

  const fetchDashboards = async () => {
    try {
      const response = await api.get("/dashboard/");
      setDashboards(response.data);
    } catch (error) {
      if (error.response && error.response.status === 401) {
        // If unauthorized, redirect to login
        navigate("/login");
      }
    }
  };

  const createDashboard = async () => {
    try {
      await api.post("/dashboard/", { title });
      setTitle("");
      fetchDashboards();
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <h2>My Dashboards</h2>
      <ul>
        {dashboards.map((db) => (
          <li key={db.id} onClick={() => navigate(`/dashboard/${db.id}`)}>
            {db.title}
          </li>
        ))}
      </ul>

      <div>
        <input
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          placeholder="New Dashboard Title"
        />
        <button onClick={createDashboard}>Create Dashboard</button>
      </div>
    </div>
  );
}

export default DashboardListPage;
